import React from "react";
import "./placegrid.css";

export default function PlaceGrid({ places, onOpen }) {
  return (
    <div className="place-grid">
      {places.map((p) => (
        <div key={p.id} className="place-card" onClick={() => onOpen(p)}>
          <img
            src={p.photo_url || "https://via.placeholder.com/200"}
            alt={p.name}
          />
          <h4>{p.name}</h4>
        </div>
      ))}
    </div>
  );
}
